bool c_base_player::IsNotTarget()
{
	if (!this || this == g::local_player)
		return true;

	if (m_iHealth() <= 0)
		return true;

	if (m_bGunGameImmunity())
		return true;

	if (m_fFlags() & FL_FROZEN)
		return true;

	int entIndex = EntIndex();
	return entIndex > g::global_vars->maxClients;
}

