bool c_base_player::CanSeePlayer(c_base_player* player, const Vector& pos)
{
	CGameTrace tr;
	Ray_t ray;
	CTraceFilter filter;
	filter.pSkip = this;

	ray.Init(GetEyePos(), pos);
	interfaces::engine_trace->trace_ray(ray, MASK_VISIBLE, &filter, &tr);

	return tr.hit_entity == player || tr.fraction > 0.97f;
}

